    and Observation Points for Natural Bridges National Monument Vegetation Mapping
    Project",nt"tracking_summary": {ntt"total": 31,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2013-03-15T12:01:44.349435",nt"name":
    "field-plot-and-observation-points-for-natural-bridges-national-monument-vegetation-mapping-proj",nt"isopen":
    false,nt"url": null,nt"notes": "This point file displays the 97 field plot
    and observation points visited in 2003 & 2004 as part of the vegetation mapping
    project. Sample plots were located subjectively in representative vegetation throughout
    the park. Field crews decided where and when to use observation points or vegetation
    plots to sample the vegetation. Vegetation plots were placed in stands judged by
    field crews to represent legitimate vegetation types that could be classified to
    the National Vegetation Classification (NVC) system using standard multivariate
    analysis techniques. Observation points were placed in stands (1) if the vegetation
    was highly altered and therefore not classifiable, (2) to provide information about
    the distribution of common vegetation types adequately sampled in vegetation plots,
    or (3) if the stand represented a unique vegetation type that was too small to hold
    a 400m2 sample plot (e.g., seeps, Hanging Gardens). The points were originally GPSed
    (using recreational GPS units), coordinates noted on the field sheets and then typed
    into the database.",nt"license_title": null,nt"extras": [{ntt"key":
